import React, { Component } from "react";
import Fade from "react-slideshow-image/lib/components/slideshow/fade";
import lehigh from "../images/lehigh.png";

const fadeImages = [lehigh];

const fadeProperties = {
  duration: 2500,
  transitionDuration: 1000,
  infinite: true,
  indicators: true,
  arrows: true,
  onChange: (oldIndex, newIndex) => {
    console.log(`slide transition from ${oldIndex} to ${newIndex}`);
  }
};

class Education extends Component {
  state = {};

  render() {
    return (
      <div className="education">
        <div className="slide-container">
          <Fade {...fadeProperties}>
            <div className="each-fade lehigh-photo-container">
              <div className="image-container lehigh-photo">
                <img src={fadeImages[0]} alt="Lehigh University 1" />
              </div>
            </div>
            <div className="each-fade lehigh-photo-container">
              <div className="image-container lehigh-photo">
                <img src={fadeImages[0]} alt="Lehigh University 2" />
              </div>
            </div>
          </Fade>
        </div>
        <div className="lehigh-text-container">
          <h3 className="lehigh-name">LEHIGH UNIVSERSITY</h3>
          <h3 className="lehigh-address">Bethlehem, Pennsylvania</h3>
          <br />
          <p className="lehigh-degree">
            2006 - 2010 | Bachelor of Science; <b>Finance</b>
          </p>
          <p className="lehigh-minor">
            <i>Minor in Psychology and Sociology</i>
          </p>
        </div>
      </div>
    );
  }
}

export default Education;
